import styled from "styled-components";

export const Container=styled.div``

export const Nav=styled.div`
display: flex;
justify-content: space-between;
flex-direction:row;
align-items: center;
`

export const NavLogo=styled.div``

export const Navs=styled.div`
display: flex;
flex-direction:row;
align-items: center;
`

export const Sign=styled.div`
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 24px;
line-height: 37px;
color: #FFFFFF;
background: #58A9A5;
border-radius: 15px;
width: 251px;
